PRIVATLEASINGKAMPANJ! 12MÅN/1000MIL! INGEN FÖRSTA BETALNING! KÖP TILL EV EXTRAMIL! SNABB LEVERANS! OLIKA FÄRGER! EV METALLICLACK TILLKOMMER! 18tum Lättmetallfälgar;
6 st högtalare; Aluminium sportpedaler; Automatisk avbländbar innerbackspegel; Innertak, svart;
Mittkonsol med armstöd Inkl. USB-port & mugghållare fram; Svart kontrasttak; Tygklädsel med
läderlook GS;
Interiör & Exteriör
Chassi & Bromsar ABS bromsar (15tum skivor fram + 14tum skivor bak);
Aktiv filhållningsassistans; Autobroms och varningssensor med fotgängar- & cyklistskydd;
Bältespåminnare bak; Bältespåminnare fram; Elektrisk parkeringsbroms; ISOFIX-fästen för barnstolar
på ytterplatserna bak; Kollisionsvarning fram, all hastighet; Krockkuddar fram, sidokrockkuddar och
krockgardiner; LED blinkers fram&bak; LED Dimljus; LED DRL (Varselljus); LED Lampor bak; LED
Strålkastare; Trafikskyltsavläsning; Tröttshetsvarnare (Driver Attention Warning);
Säkerhet
Apple CarPlay & Android Auto; DAB, DAB+ & DMB audio module; Multimedia Pro: 10tum pekskärm &
10tum digital-insturmentpanel Opel Pure Panel;
Media
Förarassitans Backkamera 180 °; Parkeringsensorer bak; Regnsensor;
Säten Baksäte fällbart 60:40; Uppvärmda framsäten;
Klimat Elektronisk klimatanläggning; Uppvärmd ratt;
Fönster & Dörrar Elmanövrerade fönsterhissar fram och bak; Mörktonadebakrutor;
